import React, { Component } from "react";

class Contact extends Component {
    render() {
        return (
            <div>
                <h2>CONTACT ME</h2>
                <ul>
                <li></li>
                    <p><a href="https://www.linkedin.com/in/anthony-frazier-73b561202/"> linkedin </a> </p>
                    <p><a href="https://www.linkedin.com/in/anthony-frazier-73b561202/"> github </a> </p>
                </ul>
            </div>
        );
    }
}

export default Contact;
